import React from 'react'
import image1 from './images/image.jpg'


const Service = () => {
  const images = [
    {
      url: '(${image1})',
      title: 'Social Media Marketing',
    },
    {
      url: '(${image2})',
      title: 'Social Media Advertisements',
    },
    {
      url: '(${image3})',
      title: 'Search Engine Optimization',
    },
  ];

  const styles = {
    section: {
      padding: '40px 0',
      background: '#f5f5f5',
    },
    heading: {
      textAlign: 'center',
      marginBottom: '20px',
    },
    imageGallery: {
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      flexWrap: 'wrap',
    },
    imageContainer: {
      textAlign: 'center',
      margin: '20px',
    },
    image: {
      width: '200px',
      height: '200px',
      objectFit: 'cover',
    },
    imageTitle: {
      marginTop: '10px',
      fontSize: '16px',
      fontWeight: 'bold',
    },
  };
  return (
    <section className="digital-marketing">
    <h2>Digital Marketing</h2>
    <div className="image-gallery">
      {images.map((image, index) => (
        <div key={index} className="image-container">
          <img src={image.url} alt={image.title} className="image" />
          <p className="image-title">{image.title}</p>
        </div>
      ))}
    </div>
  </section>
  
  )
}

export default Service
